ospective target business who executed a waiver of any and all rights to the monies held in the Trust Account (whether or not such waiver is enforceable) nor will it apply to any claims under our indemnity of the underwriters of this offering against certain liabilities, including liabilities under the Securities Act. However, we have not asked our sponsor to reserve for such indemnification obligations, nor have we independently verified whether our sponsor has sufficient funds to satisfy its indemnity obligations and believe that our sponsors only assets are securities of our company. Therefore, we cannot assure you that our sponsor would be able to satisfy those obligations. None of our officers or directors will indemnify us for claims by third parties including, without limitation, claims by vendors and prospective target businesses.
JWACs stockholders may be held liable for claims by third parties against JWAC to the extent of distributions received by them.
If JWAC is unable to complete the Business Combination or another business combination within the required time period, JWAC will (i) cease all operations except for the purpose of winding up, (ii) as promptly as reasonably possible but not more than ten (10) business days thereafter, redeem 100% of the outstanding public shares, at a per-share price, payable in cash, equal to the aggregate amount then on deposit in the Trust Account, including interest earned on the funds held in the Trust Account and not previously released to JWAC to pay taxes (less up to $50,000 of interest to pay dissolution expenses), divided by the number of then outstanding JWAC public shares, which redemption will completely extinguish public stockholders rights as stockholders (including the right to receive further liquidation distributions, if any), subject to applicable law, and (iii) as promptly as reasonably possible following such redemption, subject to the approval of JWACs remaining shareholders and its board of directors, dissolve and liquidate, subject (in each case above) to JWACs obligations under the Delaware law to provide for claims of creditors and the requirements of other applicable law. JWAC cannot assure you that it will properly assess all claims that may be potentially brought against JWAC. As a result, JWACs stockholders could potentially be liable for any claims to the extent of distributions received by them (but no more) and any liability of its stockholders may extend well beyond the third anniversary of the date of distribution. Accordingly, JWAC cannot assure you that third parties will not seek to recover from its stockholders amounts owed to them by JWAC.
Additionally, if JWAC is forced to file a bankruptcy case or an involuntary bankruptcy case is filed against it that is not dismissed, any distributions received by stockholders could be viewed under applicable debtor/creditor and/or bankruptcy laws as either a preferential transfer or a fraudulent conveyance. As a result, a bankruptcy court could seek to recover all amounts received by JWACs stockholders. Because JWAC intends to distribute the proceeds held in the Trust Account to its public stockholders promptly after the expiration of the time period to complete a business combination, this may be viewed or interpreted as giving preference to its public stockholders over any potential creditors with respect to access to or distributions from its assets. Furthermore, JWACs board of directors may be viewed as having breached their fiduciary duties to its creditors and/or may have acted in bad faith, and thereby exposing itself and JWAC to claims of punitive damages, by paying public stockholders from the Trust Account prior to addressing the claims of creditors. JWAC cannot assure you that claims will not be brought against it for these reasons.
JWAC may be a target of securities class action and derivative lawsuits which could result in substantial costs and may delay or prevent the Business Combination from being completed.
Securities class action lawsuits and derivative lawsuits are often brought against companies that have entered into business combination agreements or similar agreements. Even if the lawsuits are without merit, defending against these claims can result in substantial costs and divert management time and resources. An adverse judgment could result in monetary damages, which could have a negative impact on JWACs liquidity and financial condition. Additionally, if a plaintiff is successful in obtaining an injunction prohibiting consummation of the Business Combination, then that injunction may delay or prevent it from being completed. Currently, JWAC is not aware of any securities class action lawsuits or derivative lawsuits being filed in connection with the Business Combination.
