We are a newly formed company with a very limited operating history and, accordingly, you will not have any substantial basis on which to evaluate our ability to achieve our business objective.
We are a newly formed company with very limited operating results to date. Since we do not have a substantial operating history, you will have a very limited basis upon which to evaluate our ability to achieve our business objective, which is to acquire an operating business. We will not generate any revenues until, at the earliest, after the consummation of a business combination.
Our independent registered public accounting firms report contains an explanatory paragraph that expresses substantial doubt about our ability to continue as a going concern, since we will cease all operations except for the purpose of liquidating if we are unable to complete an initial business combination by March 9, 2023 (or such later date as may be extended by means of a further contribution to the Trust Account in accordance with the JWAC Certificate of Incorporation or amendment to such certificate).
As of September 30, 2022, JWAC had $610,382 in cash held outside of the Trust Account for its working capital needs. JWAC has incurred and expects to continue to incur significant costs in pursuit of its acquisition plans. We may need to raise additional funds in order to meet the expenditures required for operating our business. Further, if our estimates of the costs of identifying a target business, undertaking in-depth due diligence and negotiating an initial business combination are less than the actual amount necessary to do so, we may have insufficient funds available to operate our business prior to our initial business combination. Moreover, we may need to obtain additional financing either to complete our initial business combination or because we become obligated to redeem a significant number of our public shares upon completion of our initial business combination, in which case we may issue additional securities or incur debt in connection with such business combination. In addition, we intend to target businesses larger than we could acquire with the net proceeds of our initial public offering and the sale of the placement units, and may as a result be required to seek additional financing to complete such proposed initial business combination. Subject to compliance with applicable securities laws, we would only complete such financing simultaneously with the completion of our initial business combination. If we are unable to complete our initial business combination because we do not have sufficient funds available to us, we will be forced to cease operations and liquidate the Trust Account. In addition, following our initial business combination, if cash on hand is insufficient, we may need to obtain additional financing in order to meet our obligations. While JWAC intends to complete the proposed Business Combination before March 9, 2023 (or such later date as may be extended by means of a further contribution to the Trust Account in accordance with the JWAC Certificate of Incorporation or amendment to such certificate) there are no assurances that this will happen. The date for mandatory liquidation and subsequent dissolution raise substantial doubt about JWACs ability to continue as a going concern. The financial statements do not include any adjustments that might result from the outcome of this uncertainty. These factors, among others, raise substantial doubt about our ability to continue as a going concern. The financial statements contained elsewhere in this Annual Report do not include any adjustments that might result from our inability to consummate an initial business combination or our inability to continue as a going concern.
Changes in laws or regulations, or a failure to comply with any laws and regulations, may adversely affect our business, investments and results of operations.
We are subject to laws and regulations enacted by national, regional and local governments. In particular, we will be required to comply with certain SEC and other legal requirements. Compliance with, and monitoring of, applicable laws and regulations may be difficult, time consuming and costly. Those laws and regulations and their interpretation and application may also change from time to time and those changes could have a material adverse effect on our business, investments and results of operations. In addition, a failure to comply with applicable laws or regulations, as interpreted and applied, could have a material adverse effect on our business and results of operations.
We are an emerging growth company and a smaller reporting company within the meaning of the Securities Act, and if we take advantage of certain exemptions from disclosure requirements available to emerging growth companies or smaller reporting companies, this could make our securities less attractive to investors and may make it more difficult to compare our performance with other public companies.
We are an emerging growth company within the meaning of the Securities Act, as modified by the JOBS Act, and we may take advantage of certain exemptions from various reporting requirements that are applicable to other public companies that are not emerging growth companies including, but not limited to, not being required to comply with the auditor attestation requirements of Section 404 of the Sarbanes-Oxley Act, reduced disclosure obligations regarding executive compensation in our periodic reports and proxy statements, and exemptions from the requirements of holding a nonbinding advisory vote on executive compensation and shareholder approval of any golden parachute payments not previously approved. As a result, our shareholders may not have access to certain information they may deem important. We could be an emerging growth company for up to five years, although circumstances could cause us to lose that status earlier, including if the market value of our common stock held by non-affiliates exceeds $700 million as of any March 31 before that time, in which case we would no longer be an emerging growth company as of the following September 30. We cannot predict whether investors will find our securities less attractive because we will rely on these exemptions. If some investors find our securities less attractive as a result of our reliance on these exemptions, the trading prices of our securities may be lower than they otherwise would be, there may be a less active trading market for our securities and the trading prices of our securities may be more volatile.
Further, Section 102(b)(1) of the JOBS Act exempts emerging growth companies from being required to comply with new or revised financial accounting standards until private companies (that is, those that have not had a Securities Act registration statement declared effective or do not have a class of securities registered under the Exchange Act) are required to comply with the new or revised financial accounting standards. The JOBS Act provides that a company can elect to opt out of the extended transition period and comply with the requirements that apply to non-emerging growth companies but any such an election to opt out is irrevocable. We have elected not to opt out of such extended transition period which means that when a standard is issued or revised and it has different application dates for public or private companies, we, as an emerging growth company, can adopt the new or revised standard at the time private companies adopt the new or revised standard. This may make comparison of our financial statements with another public company which is neither an emerging growth company nor an emerging growth company which has opted out of using the extended transition period difficult or impossible because of the potential differences in accounting standards used.
Additionally, we are a smaller reporting company as defined in Item 10(f)(1) of Regulation S-K. Smaller reporting companies may take advantage of certain reduced disclosure obligations, including, among other things, providing only two years of audited financial statements. We will remain a smaller reporting company until the last day of the fiscal year in which (1) the market value of our ordinary shares held by non-affiliates equals or exceeds $250 million as of the prior March 31, or (2) our annual revenues equaled or exceeded $100 million during such completed fiscal year and the market value of our ordinary shares held by non-affiliates equals or exceeds $700 million as of the prior March 31. To the extent we take advantage of such reduced disclosure obligations, it may also make comparison of our financial statements with other public companies difficult or impossible.
