Overview
We are a blank check company formed under the laws of the State of Delaware on September 14, 2021 for the purpose of effecting a merger, capital stock exchange, asset acquisition, stock purchase, reorganization or other similar business combination with one or more businesses. We intend to effectuate our business combination using cash from the proceeds of the initial public offering and the sale of the private units, our capital stock, debt or a combination of cash, stock and debt.
All activity through September 30, 2022 relates to our formation, initial public offering, and search for a prospective Initial Business Combination.
Results of Operations
We have neither engaged in any operations nor generated any revenues to date. Our only activities from inception through September 30, 2022 were organizational activities and those necessary to prepare for the initial public offering, described below, and searching for a prospective Initial Business Combination. We do not expect to generate any operating revenues until after the completion of our Initial Business Combination. We expect to generate non-operating income in the form of interest income on marketable securities held after the initial public offering. We incur expenses as a result of being a public company (for legal, financial reporting, accounting and auditing compliance), as well as for due diligence expenses related to our search for targets for our Initial Business Combination.
For the year ended September 30, 2022, we had a net loss of $176,852, which consisted of operating costs of $970,268 and interest income of $793,416 on marketable securities held in the Trust Account.
Liquidity and Capital Resources
On December 9, 2021, we consummated the initial public offering of 13,800,000 units, which included the full exercise of the underwriters option to purchase up to an additional 1,800,000 units at the initial public offering price to cover over-allotments, at a price of $10.00 per unit, generating gross proceeds of $138,000,000. Simultaneously with the closing of the initial public offering, we consummated the sale of 629,000 placement units at a price of $10.00 per placement unit in a private placement to the Sponsor and I-Bankers Securities, Inc., generating gross proceeds of $6,290,000.
Following the initial public offering and the private placement, a total of $139,380,000 was placed in the trust account. We incurred $7,985,917 consisting of $2,760,000 in cash of underwriting commissions, $4,830,000 of business combination marketing fee, and $395,917 of other offering costs.
As of September 30, 2022, we had marketable securities held in the Trust Account of $140,173,416 consisting of both cash and U.S. treasury bills with a maturity of 185 days or less.
We had $610,382 of cash held outside of the Trust Account as of September 30, 2022. The Company did not have any cash equivalents as of September 30, 2022.
We intend to use substantially all of the funds held in the trust account, including any amounts representing interest earned on the trust account to complete our business combination. We may withdraw interest to pay taxes. To the extent that our capital stock or debt is used, in whole or in part, as consideration to complete our business combination, the remaining proceeds held in the trust account will be used as working capital to finance the operations of the target business or businesses, make other acquisitions and pursue our growth strategies.
We intend to use the funds held outside the trust account primarily to identify and evaluate target businesses, perform business due diligence on prospective target businesses, travel to and from the offices, plants or similar locations of prospective target businesses or their representatives or owners, review corporate documents and material agreements of prospective target businesses, and structure, negotiate and complete a business combination.
In order to fund working capital deficiencies or finance transaction costs in connection with a business combination, our Sponsor or an affiliate of our Sponsor or certain of our officers and directors may, but are not obligated to, loan us funds as may be required. If we complete a business combination, we may repay such loaned amounts out of the proceeds of the trust account released to us. In the event that a business combination does not close, we may use a portion of the working capital held outside the trust account to repay such loaned amounts, but no proceeds from our trust account would be used for such repayment. Up to $1,500,000 of such loans may be convertible into units, at a price of $10.00 per unit, at the option of the lender. The units would be identical to the placement units.
We anticipate that the $610,382 outside of the Trust account as of September 30, 2022 will not be sufficient to allow us to operate for at least the next 12 months, assuming that a Business Combination is not consummated during that time. Moreover, we may need to obtain additional financing to consummate our Initial Business Combination but there is no assurance that new financing will be available to us on commercially acceptable terms. Furthermore, if we are not able to consummate a Business Combination by March 9, 2023, it will trigger our automatic winding up, liquidation and dissolution. We may extend the Combination Period by up to three months if the Sponsor deposits $1,380,000 into our Trust Account for three-month extension but there is no assurance that the Sponsor will do so. These conditions raise substantial doubt about our ability to continue as a going concern.
