Note 1 - Organization and Business Operations
Jupiter Wellness Acquisition Corporation (the Company) is a blank check company incorporated on September 14, 2021 under the laws of the State of Delaware for the purpose of entering into a merger, share exchange, asset acquisition, stock purchase, recapitalization, reorganization or other similar business combination with one or more businesses or entities (a Business Combination). On October 26, 2022, the Company identified a target company for a Business Combination and activities in connection with the proposed acquisition of Chijet Inc., a Cayman Islands exempted company (see Note 7). The Company will not generate any operating revenues until after consummation of the initial Business Combination, at the earliest. The Company will generate non-operating income in the form of interest income from the proceeds derived from the IPO.
As of September 30, 2022, the Company had not yet commenced any operations. All activity through September 30, 2022 relates to the Companys formation and the its initial Public Offering (as defined below). The Company will not generate any operating revenues until after the completion of a Business Combination, at the earliest. The Company will generate non-operating income in the form of interest income from the proceeds derived from the IPO. The Company has selected September 30 as its fiscal year end.
On December 9, 2021, the Company consummated its IPO of 13,800,000 units (the Units and, with respect to the shares of Class A common stock included in the Units, the Public Shares) at $10.00 per unit, which included 1,800,000 Units issued pursuant to the full exercise by the Underwriters (as defined below) of their over-allotment option, and the private sale of an aggregate of 629,000 Units (the Private Placement Units and with respect to the shares of Class A common stock included in the Units, the Private Placement Shares) to its sponsor, Jupiter Wellness Sponsor LLC (the Sponsor) and I-Bankers Securities, Inc. (I-Bankers) at a purchase price of $10.00 per Private Placement Unit, generating gross proceeds of $6,290,000 to the Company that closed simultaneously with the closing of the IPO (see Note 3). The Companys Units have been listed on the Nasdaq Global Market (Nasdaq).
Transaction costs amounted to $7,985,917 consisting of $2,760,000 in cash of underwriting commissions, $4,830,000 of business combination marketing fee, and $395,917 of other offering costs. In addition, as of December 9, 2021, cash of $1,630,676 was held outside of the Trust Account (as defined below) and is available for working capital purposes.
The Companys management has broad discretion with respect to the specific application of the net proceeds of the IPO and the sale of the Private Placement Units, although substantially all of the net proceeds are intended to be applied generally toward consummating a Business Combination. There is no assurance that the Company will be able to complete a Business Combination successfully. The Company must complete a Business Combination with one or more operating businesses or assets that together have an aggregate fair market value equal to at least 80% of the net assets held in the Trust Account (net of amounts disbursed to management for working capital purposes, if permitted, and excluding the amount of any deferred underwriting commissions) at the time of the Companys signing a definitive agreement in connection with its initial Business Combination. The Company will only complete a Business Combination if the post-transaction company owns or acquires 50% or more of the outstanding voting securities of the target or otherwise acquires an interest in the target business or assets sufficient for it not to be required to register as an investment company under the Investment Company Act of 1940, as amended (the Investment Company Act).
Upon the closing of the IPO on December 9, 2021, the Company deposited $139,380,000 ($10.10 per Unit) from the proceeds of the IPO and certain proceeds of the sales of Private Placement Units in the trust account (Trust Account), located in the United States and invested only in U.S. government securities, within the meaning set forth in Section 2(a)(16) of the Investment Company Act, with a maturity of 185 days or less or in any open-ended investment company that holds itself out as a money market fund selected by the Company meeting certain conditions of Rule 2a-7 of the Investment Company Act, as determined by the Company, until the earlier of: (i) the completion of a Business Combination and (ii) the distribution of the funds held in the Trust Account, as described below.
