The Company will provide its stockholders with the opportunity to redeem all or a portion of their Public Shares upon the completion of a Business Combination either (i) in connection with a stockholder meeting called to approve the Business Combination or (ii) by means of a tender offer. The decision as to whether the Company will seek stockholder approval of a Business Combination or conduct a tender offer will be made by the Company. The stockholders will be entitled to redeem their shares for a pro rata portion of the amount held in the Trust Account (initially $10.10 per share), calculated as of two business days prior to the completion of a Business Combination, including any pro rata interest earned on the funds held in the Trust Account and not previously released to the Company to pay its tax obligations. The shares of Class A common stock will be recorded at redemption value and classified as temporary equity upon the completion of the IPO, in accordance with Accounting Standards Codification (ASC) Topic 480 Distinguishing Liabilities from Equity.
The Company will proceed with a Business Combination only if the Company has net tangible assets of at least $5,000,001 upon such completion of a Business Combination and, if the Company seeks stockholder approval, a majority of the outstanding shares voted are voted in favor of the Business Combination.
If the Company seeks stockholder approval in connection with a Business Combination, the Sponsor has agreed to (i) waive its redemption rights with respect to their Private Placement Shares in connection with the completion of the Business Combination, (ii) waive its redemption rights with respect to their Private Placement Shares in connection with a stockholder vote to approve an amendment to the Companys second amended and restated certificate of incorporation (a) to modify the substance or timing of the Companys obligation to redeem 100% of the Public Shares if the Company does not complete the Business Combination within the Combination Period (as defined below) or (b) with respect to any other provision relating to stockholders rights or pre-initial Business Combination activity and (iii) waive its rights to liquidating distributions from the Trust Account with respect to their Private Placement Shares if the Company fails to complete the Business Combination within the Combination Period. In addition, the Sponsor has agreed to vote any share it held in favor of the Business Combination.
Additionally, each public stockholder may elect to redeem its Public Shares, without voting, and if they do vote, irrespective of whether they vote for or against a proposed Business Combination.
Notwithstanding the foregoing, if the Company seeks stockholder approval of a Business Combination and it does not conduct redemptions pursuant to the tender offer rules, the Companys second amended and restated certificate of incorporation provides that a public stockholder, together with any affiliate of such stockholder or any other person with whom such stockholder is acting in concert or as a group (as defined under Section 13 of the Securities Exchange Act of 1934, as amended (the Exchange Act)), will be restricted from redeeming its shares with respect to more than an aggregate of 15% of the Public Shares without the Companys prior written consent.
The Company will have until 12 months from the closing of the IPO (or 18 months from the closing of the IPO if the Company may extend the period of time to consummate a Business Combination) (the Combination Period) to complete a Business Combination. If the Company is unable to complete a Business Combination within the Combination Period, the Company will (i) cease all operations except for the purpose of winding up, (ii) as promptly as reasonably possible but no more than 10 business days thereafter, redeem 100% of the outstanding Public Shares, at a per-share price, payable in cash, equal to the aggregate amount then on deposit in the Trust Account, including interest earned (less up to $50,000 of interest to pay dissolution expenses), divided by the number of then outstanding Public Shares, which redemption will completely extinguish public stockholders rights as stockholders (including the right to receive further liquidation distributions, if any), and (iii) as promptly as reasonably possible following such redemption, subject to the approval of the remaining stockholders and the Companys board of directors, dissolve and liquidate, subject in each case to the Companys obligations under Delaware law to provide for claims of creditors and requirements of other applicable law.
