Underwriting Agreement and Business Combination Marketing Agreement
The Company engaged I-Bankers as the representative of the underwriters (the Underwriters) in the IPO of the Companys Class A common stock, par value of $0.0001 per share (Shares), for $120 million and the simultaneous listing on Nasdaq. Pursuant to that certain underwriting agreement, I-Bankers acted as the representative of the Underwriters of the IPO for 12,000,000 Units at $10.00 per unit, plus an over-allotment option equal to 15% of the number of Units offered, or 1,800,000 Units, which was exercised in full simultaneously upon the closing of the IPO. The Company paid I-Bankers underwriters commission of $2,760,000, equal to 2.0% of the gross proceeds raised in the IPO for such services upon the consummation of the IPO (exclusive of any applicable finders fees which might become payable).
