Warrants
ASC 480 requires a reporting entity to classify certain freestanding financial instruments as liabilities (or in some cases as assets). ASC 480-10-S99 addresses concerns raised by the SEC regarding the financial statement classification and measurement of securities subject to mandatory redemption requirements or whose redemption is outside the control of the issuer. If the stock subject to mandatory redemption provisions represents the only shares in the reporting entity, it must report instruments in the liabilities section of its statement of financial position. The stock subject must then describe them as shares subject to mandatory redemption, so as to distinguish the instruments from other financial statement liabilities. The Company concludes that the warrants to I-Bankers do not exhibit any of the above characteristics and, therefore, are outside the scope of ASC 480. The warrants were issued in accordance with the guidance contained in ASC 815-40, Derivatives and Hedging - Contracts in Entitys Own Equity. Such guidance provides that because the warrants meet the criteria for equity treatment.
