Subject to the terms and conditions of the BCA, Pubco will acquire all of the issued and outstanding shares of Chijet from the Sellers (Purchased Shares) in exchange for ordinary shares of Pubco and Chijet shall surrender for no consideration its shares in Pubco, such that Chijet becomes a wholly owned subsidiary of Pubco and the Sellers become shareholders of Pubco (the Share Exchange). Immediately thereafter, Merger Sub will merge with and into the Company, with the Company continuing as the surviving entity, as a result of which, (i) the Company shall become a wholly owned subsidiary of Pubco, and (ii) each issued and outstanding security of the Company immediately prior to the consummation of the Business Combination shall no longer be outstanding and shall automatically be cancelled, in exchange for the right of the holder thereof to receive a substantially equivalent security of Pubco (and with the holders of the Companys publicly traded shares of Class A common stock, par value $0.0001 per share (Company Class A Common Stock), that do not redeem their shares also receiving one (1) contingent value right (CVR, as defined in the BCA) for each share of Company Class A Common Stock held).
Pursuant to the BCA, at the closing, Pubco shall issue and deliver to the Sellers an aggregate number of Pubco ordinary shares (the Exchange Shares) with an aggregate value equal to One Billion Six Hundred Million U.S. Dollars ($1,600,000,000), with each Pubco ordinary share valued at the redemption price, and with each Seller receiving its pro rata share of the applicable Exchange Shares based on the number of Purchased Shares owned by such Seller, divided by the total number of purchased shares owned by all Sellers. However, the issuance to certain of the Sellers (the Earnout Participants) of Exchange Shares having a value of Six Hundred and Seventy Four Million U.S. Dollars ($674,000,000), with each of such shares being valued at the redemption price (such Pubco ordinary shares, subject to equitable adjustment for share splits, share dividends, combinations, recapitalizations and the like after the closing, including to account for any equity securities into which such shares are exchanged or converted, and together with the earnings thereof, the Earnout Shares), and each of the Earnout Participants shall have the contingent right to receive a pro rata portion of such Earnout Shares and earnings thereon (such pro rata allocation based on the number of Purchased Shares owned by such Earnout Participant, divided by the total number of Purchased Shares owned by all Earnout Participants) based on Pubco and its subsidiaries achieving certain financial performance metrics over for calendar years 2023, 2024 and 2025 or meeting certain stock price metrics from the closing until 30 trading days after the date on which Pubco files its annual report for the calendar year ended December 31, 2023, 2024 and 2025, respectively with the SEC. To the extent that any such Earnout Shares are not earned, they (along with income thereon) will be redistributed pro rata to the holders of CVRs.
On December 5, 2022, the company issued an unsecured promissory note (the Note) in the principal amount of $1,380,000 to Chijet. Chijet, entered into a business combination agreement with the Company, among others, on October 25, 2022. The Note is non-interest bearing and payable in cash upon the closing of the Companys initial business combination. In the event that the Company fails to complete an initial business combination prior to the deadline set forth in its governing document, no payment will be due under the Note and the principal balance of this Note will be forgiven.
In connection with the issuance of the Note, on December 5, 2022, the Company deposited an aggregate of $1,380,000 into the trust account of the Company for its public stockholders, which enables the Company to further extend the period of time it has to consummate its initial business combination by three months from December 8, 2022 to March 9, 2023 (the Extension). The Extension is the first of up to two three-month extensions permitted under the Companys governing documents. ITEM 9. CHANGES IN AND DISAGREEMENTS WITH ACCOUNTANTS ON ACCOUNTING AND FINANCIAL DISCLOSURE
