Evaluation of Disclosure Controls and Procedures
Disclosure controls and procedures are designed to ensure that information required to be disclosed by us in our Exchange Act reports is recorded, processed, summarized, and reported within the time periods specified in the SECs rules and forms, and that such information is accumulated and communicated to our management, including our principal executive officer and principal financial officer or persons performing similar functions, as appropriate to allow timely decisions regarding required disclosure.
Under the supervision and with the participation of our management, including our principal executive officer and principal financial and accounting officer, we conducted an evaluation of the effectiveness of our disclosure controls and procedures as of September 30, 2022, as such term is defined in Rules 13a-15(e) and 15d-15(e) under the Exchange Act. Based on this evaluation, our Chief Executive Officer and Chief Financial Officer have concluded that our disclosure controls and procedures were not effective, due to the two material weakness in our internal control over financial reporting related to the Companys accounting for complex financial instruments. The two material weaknesses that have been identified relate to:
(i) lack of sufficient personal resources to segregate duties within account process
(ii) lack of written policies and procedures for accounting, information technology, and financial reporting and record keeping
Management intends to implement remediation steps to improve our disclosure controls and procedures and our internal control over financial reporting. Specifically, we plan to continue to establish written policies and procedures for accounting, information technology, and financial reporting and record keeping and hiring additional competent and qualified accounting and reporting personnel.
