Number and Terms of Office of Officers and Directors
We have five directors. Our board of directors is divided into three classes with only one class of directors being elected in each year and each class (except for those directors appointed prior to our first annual meeting of stockholders) serving a three-year term. In accordance with Nasdaq corporate governance requirements, we are not required to hold an annual meeting until one year after our first fiscal year end following our listing on Nasdaq. The term of office of the first class of directors, consisting of N. Adele Hogan, Andy Goren and Robert D. Allison will expire at our first annual meeting of stockholders. The term of office of the second class of directors, consisting of Brian S. Jones and Hans Haywood, will expire at the second annual meeting of stockholders. Our amended and restated certificate of incorporation will provide that our board of directors may be removed with cause by the affirmative vote of the holders of a majority of the voting power of all of our outstanding stock.
