Committees of the Board of Directors
Our board of directors has two standing committees: an audit committee and a compensation committee. Subject to phase-in rules and a limited exception, Nasdaq rules and Rule 10A-3 of the Exchange Act require that the audit committee of a listed company be comprised solely of independent directors, and Nasdaq rules require that the compensation committee of a listed company be comprised solely of independent directors. Each committee operates under a charter that complies with Nasdaq rules, has been approved by our board of directors and has the composition and responsibilities described below.
Audit Committee
Our audit committee consists of Hans Haywood, Adele Hogan and Nancy Torres Kaufman, each of whom is an independent director under applicable Nasdaq listing standards. Hans Haywood has been appointed chair of the audit committee. The audit committees duties, which are specified in our Audit Committee Charter, include, but are not limited to:
● the appointment, compensation, retention, replacement, and oversight of the work of the independent registered public accounting firm engaged by us;
● pre-approving all audit and permitted non-audit services to be provided by the independent registered public accounting firm engaged by us, and establishing pre-approval policies and procedures;
● setting clear hiring policies for employees or former employees of the independent registered public accounting firm, including but not limited to, as required by applicable laws and regulations;
● setting clear policies for audit partner rotation in compliance with applicable laws and regulations;
● obtaining and reviewing a report, at least annually, from the independent registered public accounting firm describing (i) the independent registered public accounting firms internal quality-control procedures, (ii) any material issues raised by the most recent internal quality-control review, or peer review, of the audit firm, or by any inquiry or investigation by governmental or professional authorities within the preceding five years respecting one or more independent audits carried out by the firm and any steps taken to deal with such issues and (iii) all relationships between the independent registered public accounting firm and us to assess the independent registered public accounting firms independence;
● reviewing and approving any related party transaction required to be disclosed pursuant to Item 404 of Regulation S-K promulgated by the SEC prior to us entering into such transaction; and
● reviewing with management, the independent registered public accounting firm, and our legal advisors, as appropriate, any legal, regulatory or compliance matters, including any correspondence with regulators or government agencies and any employee complaints or published reports that raise material issues regarding our financial statements or accounting policies and any significant changes in accounting standards or rules promulgated by the Financial Accounting Standards Board, the SEC or other regulatory authorities.
Financial Experts on Audit Committee
Our audit committee will at all times be composed exclusively of independent directors who are financially literate as defined under applicable Nasdaq listing standards. Nasdaqs standards define financially literate as being able to read and understand fundamental financial statements, including a companys balance sheet, income statement and cash flow statement.
In addition, we must certify to Nasdaq that the committee has, and will continue to have, at least one member who has past employment experience in finance or accounting, requisite professional certification in accounting, or other comparable experience or background that results in the individuals financial sophistication. The Board has determined that Hans Hayward qualifies as an audit committee financial expert, as defined under rules and regulations of the SEC.
Compensation Committee
Our compensation committee consists of Hans Haywood and Adele Hogan, each of whom is an independent director under applicable Nasdaq listing standards. The compensation committees duties, which are specified in our compensation committee charter, include, but are not limited to:
