Code of Ethics
We have adopted a code of ethics that applies to all of our executive officers, directors and employees. The code of ethics codifies the business and ethical principles that govern all aspects of our business.
Conflicts of Interest
In general, officers and directors of a corporation incorporated under the laws of the State of Delaware are required to present business opportunities to a corporation if:
● the corporation could financially undertake the opportunity;
● the opportunity is within the corporations line of business; and
● it would not be fair to the corporation and its stockholders for the opportunity not to be brought to the attention of the corporation.
JWACs Code of Ethics requires it to avoid, wherever possible, all related party transactions that could result in actual or potential conflicts of interests, except under guidelines approved by the Board (or the audit committee). Related-party transactions are defined as transactions in which (1) the aggregate amount involved will or may be expected to exceed $120,000 in any calendar year, (2) JWAC or any of its subsidiaries is a participant, and (3) any (a) executive officer, director or nominee for election as a director, (b) greater than 4% beneficial owner of JWAC Common Stock, or (c) immediate family member of the persons referred to in clauses (a) and (b), has or will have a direct or indirect material interest (other than solely as a result of being a director or a less than 10% beneficial owner of another entity). A conflict of interest situation can arise when a person takes actions or has interests that may make it difficult to perform his or her work objectively and effectively. Conflicts of interest may also arise if a person, or a member of his or her family, receives improper personal benefits as a result of his or her position.
JWACs audit committee, pursuant to its written charter, is responsible for reviewing and approving related-party transactions to the extent JWAC enters into such transactions. The audit committee will consider all relevant factors when determining whether to approve a related party transaction, including whether the related party transaction is on terms no less favorable to JWAC than terms generally available from an unaffiliated third-party under the same or similar circumstances and the extent of the related partys interest in the transaction. No director may participate in the approval of any transaction in which he is a related party, but that director is required to provide the audit committee with all material information concerning the transaction. JWAC also requires each of its directors and executive officers to complete a directors and officers questionnaire that elicits information about related party transactions.
These procedures are intended to determine whether any such related party transaction impairs the independence of a director or presents a conflict of interest on the part of a director, employee or officer.
To further minimize conflicts of interest, if such related party transaction were to occur, JWAC has agreed not to consummate an initial business combination with an entity that is affiliated with any of the Sponsor, officers or directors of JWAC unless JWAC has obtained an opinion from an independent investment banking firm which is a member of FINRA or an independent accounting firm that our initial business combination is fair to our company from a financial point of view. ITEM 11. EXECUTIVE COMPENSATION
