Restrictions on Transfers of Founder Shares and Private shares
Our sponsor beneficially owns approximately 2.70% of our issued and outstanding shares of Class A Common Stock and 83.17% of our issued and outstanding shares of Class B Common Stock. Because of the ownership block held by our sponsor, who is managed by Mr. Brian John, our sponsor and Mr. John may be able to effectively exercise influence over all matters requiring approval by our stockholders, including the election of directors and approval of significant corporate transactions other than approval of our initial business combination.
The founder shares, private placement units, private placement shares, private placement rights, any shares of Class A common stock issued upon conversion thereof and the post business combination shares are each subject to transfer restrictions pursuant to lock-up provisions in a letter agreement with us to be entered into by our sponsor, officers and directors. Subject to certain limited exceptions, our initial stockholders, officers and directors have agreed not to transfer, assign or sell 50% of their founder shares and post business combination shares, as applicable, until the earlier of (i) six months after the date of the consummation of our initial business combination or (ii) the date on which the closing price of our shares of common stock equals or exceeds $12.50 per share (as adjusted for stock sub-divisions, stock dividends, reorganizations and recapitalizations) for any 20 trading days within any 30-trading day period commencing after our initial business combination and the remaining 50% of the founder shares and post business combination shares, as applicable, may not be transferred, assigned or sold until six months after the date of the consummation of our initial business combination, or earlier, in either case, if, subsequent to our initial business combination, we consummate a subsequent liquidation, merger, stock exchange or other similar transaction which results in all of our stockholders having the right to exchange their shares of common stock for cash, securities or other property.
Any permitted transferees will be subject to the same restrictions and other agreements of our initial stockholders, officers and directors with respect to any founder shares and post business combination shares, as applicable. In addition, the lock-up provisions of the insider letter provide that the private placement units, private placement shares, private placement rights, and any shares of Class A common stock issued upon conversion thereof are not transferable or salable until 30 days after the completion of our initial business combination. However, any such securities may be transferred or sold (a) to our officers or directors, any affiliates or family members of any of our officers or directors, any members of our sponsor, or any affiliates of our sponsor, (b) in the case of an individual, by gift to a member of the individuals immediate family or to a trust, the beneficiary of which is a member of one of the individuals immediate family, an affiliate of such person or to a charitable organization; (c) in the case of an individual, by virtue of laws of descent and distribution upon death of the individual; (d) in the case of an individual, pursuant to a qualified domestic relations order; (e) by private sales or transfers made in connection with the consummation of an initial business combination at prices no greater than the price at which the securities were originally purchased; (f) in the event of our liquidation prior to the completion of our initial business combination; (g) by virtue of the laws of Delaware or our sponsors limited liability company agreement upon dissolution of our sponsor; or (h) in the event of our liquidation, merger, capital stock exchange, reorganization or other similar transaction which results in all of our stockholders having the right to exchange their shares of common stock for cash, securities or other property subsequent to our completion of our initial business combination; provided, however, that in the case of clauses (a) through (e) or (g) these permitted transferees must enter into a written agreement agreeing to be bound by these transfer restrictions and the other restrictions contained in the letter agreements, and by the same agreements entered into by our initial stockholders, officers and directors with respect to such securities (including provisions relating to voting, the trust account and liquidation distributions described elsewhere in this prospectus).
In order to meet our working capital needs following the consummation of our initial public offering, our sponsor, officers, directors and their affiliates may, but are not obligated to, loan us funds, from time to time or at any time, in whatever amount they deem reasonable in their sole discretion. Each loan would be non-interest bearing and be evidenced by a promissory note. The notes would either be paid upon consummation of our initial business combination, without interest, or, at holders discretion, up to $1,500,000 of the notes may be converted into shares of common stock at a price of $10.00 per share. The shares would be identical to the private shares. In the event that the initial business combination does not close, we may use a portion of the working capital held outside the trust account to repay such loaned amounts, but no proceeds from our trust account would be used for such repayment.
Our executive officers and our sponsor are our promoters, as that term is defined under the federal securities laws. ITEM 13. CERTAIN RELATIONSHIPS AND RELATED TRANSACTIONS, AND DIRECTOR INDEPENDENCE
Founder Shares
On September 20, 2021, the Sponsor purchased 2,875,000 shares of JWACs Class B Common Stock for an aggregate purchase price of $50,000.
In December 2021, JWAC effected a 0.2 for 1 stock dividend for each share of Class B Common Stock outstanding (which was accounted for as a stock split) of 575,000 shares of Class B Common Stock, which resulted in an aggregate of 3,450,000 shares of Class B common stock outstanding. The Founder Shares include an aggregate of up to 450,000 shares of Class B common stock subject to forfeiture by the Sponsor to the extent that the underwriters over-allotment is not exercised in full or in part, so that the number of Founder Shares will collectively represent 20% of JWACs issued and outstanding shares upon the completion of the IPO. On December 9, 2021, the Underwriter exercised the over-allotment option in full. As a result, no Founder Shares is subject to for forfeiture.
Private Placement
Concurrently with the closing of the IPO, the Sponsor and the underwriters purchased an aggregate of 629,000 private placement units, generating gross proceeds of $6,290,000 in aggregate in a private placement. Each private placement unit consisted of one share of Class A common stock and one right. Each right underlying the private placement unit (the Private Placement Right) entitles the holder to receive one-eighth of one share of JWAC Class A Common Stock at the closing of a business combination. The proceeds from the sale of the private placement units were added to the net proceeds from the IPO held in the Trust Account. If the Company does not complete a business combination before March 9, 2023 (or such later date as may be extended by means of a further contribution to the Trust Account in accordance with the JWAC Certificate of Incorporation or amendment to such certificate), the proceeds from the sale of the private placement units will be used to fund the redemption of the public shares (subject to the requirements of applicable law), and the private placements units and all underlying securities will expire worthless.
Executive Compensation
The Companys Chief Financial Officer receives $5,000 in cash per month as compensation for his services, commencing December 9, 2021.
Sponsor Note Payable
As of September 30, 2021, the Company had a loan payable to the Sponsor in amount of $371,650 with zero interest (the Loan). The Loan is unsecured. Under no circumstances shall any individual, including but not limited to any officer, director, employee or stockholder of the Company, be obligated personally for any obligations or liabilities of the Loan. The proceeds of the Loan are used to pay a portion of the offering expenses of the IPO. These amounts will be repaid upon completion of an initial business combination. On December 17, 2021, the balance was repaid in full and no other amounts were taken on the note.
Related Person Transactions Policy and Procedure
JWACs Code of Ethics requires it to avoid, wherever possible, all related party transactions that could result in actual or potential conflicts of interests, except under guidelines approved by the Board (or the audit committee). Related-party transactions are defined as transactions in which (1) the aggregate amount involved will or may be expected to exceed $120,000 in any calendar year, (2) JWAC or any of its subsidiaries is a participant, and (3) any (a) executive officer, director or nominee for election as a director, (b) greater than 4% beneficial owner of JWAC Common Stock, or (c) immediate family member of the persons referred to in clauses (a) and (b), has or will have a direct or indirect material interest (other than solely as a result of being a director or a less than 10% beneficial owner of another entity). A conflict of interest situation can arise when a person takes actions or has interests that may make it difficult to perform his or her work objectively and effectively. Conflicts of interest may also arise if a person, or a member of his or her family, receives improper personal benefits as a result of his or her position.
JWACs audit committee, pursuant to its written charter, is responsible for reviewing and approving related-party transactions to the extent JWAC enters into such transactions. The audit committee will consider all relevant factors when determining whether to approve a related party transaction, including whether the related party transaction is on terms no less favorable to JWAC than terms generally available from an unaffiliated third-party under the same or similar circumstances and the extent of the related partys interest in the transaction. No director may participate in the approval of any transaction in which he is a related party, but that director is required to provide the audit committee with all material information concerning the transaction. JWAC also requires each of its directors and executive officers to complete a directors and officers questionnaire that elicits information about related party transactions.
These procedures are intended to determine whether any such related party transaction impairs the independence of a director or presents a conflict of interest on the part of a director, employee or officer.
To further minimize conflicts of interest, if such related party transaction were to occur, JWAC has agreed not to consummate an initial business combination with an entity that is affiliated with any of the Sponsor, officers or directors of JWAC unless JWAC has obtained an opinion from an independent investment banking firm which is a member of FINRA or an independent accounting firm that our initial business combination is fair to our company from a financial point of view. ITEM 14. PRINCIPAL ACCOUNTING FEES AND SERVICES
